import React, { Component } from "react";
import axios from "axios";

class Post extends Component{
  state = {
    id: null
  }
  componentDidMount(){
    console.log(this.props);
    const id = this.props.match.params.post_id
    console.log(id);
    this.setState({
      id: id
    })
  }
  render(){
    return(
      <div className="container">
        <h1>{this.state.id}</h1>
      </div>
    )
  }
}

export default Post;
